export default function Settings(props) {
    const [isActive, setIsActive] = useState(false);
    return (
        <div className="settings-accordion">
            <div className="settings-title">
                <h3>Settings</h3>
                <h3>{isActive ? "-" : "+"}</h3>
            </div>
        </div>
    );
}
